import React from 'react'
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import GroupIcon from '@mui/icons-material/Group';
import WorkIcon from '@mui/icons-material/Work';
import LocationCityIcon from '@mui/icons-material/LocationCity';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';

function Sidebar() {
  return (
    <>
        <Card>
            <CardContent>
                <List sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
                    <ListItem>
                        <ListItemAvatar>
                        <Avatar>
                            <GroupIcon />
                        </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary="Employees" secondary="Manage Employee Information" />
                    </ListItem>
                    <ListItem>
                        <ListItemAvatar>
                        <Avatar>
                            <LocationCityIcon />
                        </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary="Manage Building" secondary="Manage Building Information" />
                    </ListItem>
                    <ListItem>
                        <ListItemAvatar>
                        <Avatar>
                            <WorkIcon />
                        </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary="Other" secondary="Manage Other Information" />
                    </ListItem>
                </List>
            </CardContent>
        </Card>

    </>
  )
}

export default Sidebar
